import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit,
}) => {
  return (
    <>
      <label>
        Name:
        <input type="text" name="name" />
      </label>
      <label>
        Phone:
        <input type="text" name="phone" />
      </label>
      <label>
        Email:
        <input type="text" name="email" />
      </label>
    </>
  );
};
